func shortDigest(hash []byte) string {
	if hash == nil || len(hash) == 0 {
		return "not set"
	}
	if len(hash) < 4 {
		return hex.EncodeToString(hash)
	}
	return hex.EncodeToString(hash[:4]) + "..."
}

